import React from "react";
import Navbar from "./components/Navbar";
import BasicReport from "./pages/BasicReport";
import Footer from "./components/Footer";
import { BrowserRouter, Switch } from "react-router-dom";

function App() {
  return (
    <React.Fragment>
      <Navbar />
      <BasicReport data={studentsData} />
      <Footer />
    </React.Fragment>
  );
}

const studentsData = [
  {
    code: 1,
    name: "Diego",
    lastname: "Betancourt",
    segment: "Técnico",
    entryDate: new Date("2020-07-16"),
  },
  {
    code: 2,
    name: "Juan",
    lastname: "Loyola",
    segment: "Bachillerato",
    entryDate: new Date("2020-01-10"),
  },
  {
