    lastname: "Sanclemente",
    segment: "Inglés",
    entryDate: new Date("2019-07-02"),
  },
  {
    code: 4,
    name: "Diego",
    lastname: "Betancourt",
    segment: "Inglés",
    entryDate: new Date("2020-07-16"),
  },
  {
    code: 5,
    name: "Diego",
    lastname: "Betancourt",
    segment: "Técnico",
    entryDate: new Date("2020-07-16"),
  },
  {
    code: 6,
