    lastname: "Castro",
    segment: "Técnico",
    entryDate: new Date("2020-02-13"),
  },
  {
    code: 7,
    name: "Diana",
    lastname: "Figueroa",
    segment: "Bachillerato",
    entryDate: new Date("2020-12-11"),
  },
  {
    code: 8,
    name: "Lina",
    lastname: "Moreno",
    segment: "Inglés",
    entryDate: new Date("2020-07-16"),
  },
];

const sortTypes = {
  upSort: {
    class: "sort-up",
    fn: (a, b) => a.net_worth - b.net_worth,
  },
  downSort: {
    class: "sort-down",
    fn: (a, b) => b.net_worth - a.net_worth,
  },
  defaultSort: {
    class: "sort",
    fn: (a, b) => a,
  },
};

export default App;
